import React, { FC } from "react";
import SkillsType from "../../types/SkillsType";
import "./SkillsCard.css";

type SkillCardProps = {
  item: SkillsType;
};

const SkillsCard: FC<SkillCardProps> = ({ item }) => {
  return (
    <div key={item.name}>
      {item.group === "language" && (
        <div className="card_container" key={item.name}>
          <div className="card_wrapper">

            <svg width="800px" height="800px" viewBox="0 0 20 20" version="1.1" xmlns="http://www.w3.org/2000/svg">

<g id="layer1">
<clipPath id="svgClip" clipPathUnits="objectBoundingBox">
<path d="M 10 1.7363281 L 3.3105469 4.9589844 L 1.6601562 12.195312 L 6.2890625 18 L 13.710938 18 L 18.339844 12.195312 L 16.689453 4.9589844 L 10 1.7363281 z M 10 2.8457031 L 15.820312 5.6503906 L 17.257812 11.949219 L 13.230469 17 L 6.7695312 17 L 2.7421875 11.949219 L 4.1796875 5.6503906 L 10 2.8457031 z " style="fill:#222222; fill-opacity:1; stroke:none; stroke-width:0px;"/>
</clipPath>
</g>

</svg>




            <i className={`${item.icon} skills-icon`}></i>
            <p>{item.name}</p>
            <p>{item.group}</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default SkillsCard;
